import React from "react";
import WishlistItem from "./WishlistItem";

export default function WishlistList({ value }) {
    const { Wishlist } = value;

    return (
        <div className="container-fluid">
            {wishlist.map((item) => (
                <WishlistItem key={item.id} item={item} value={value} />
            ))}
        </div>
    );
}
